import React from "react";
//border-2 border-black
const StudentSearch = () => {
  return (
    <div className="border-gray-500 h-max w-1/2 ml-2 rounded-lg bg-gray-200">
      <div className=" h-96 flex justify-center ">
        <span className="border-2 border-black text-xl justify-center mb-2 h-10 w-1/5">
          Search Studnet
        </span>

        <span className="border-2 border-black text-xl justify-center mb-2 h-10">
          Search Studnet
        </span>
      </div>
    </div>
  );
};

export default StudentSearch;
